import React from "react";
import GoogleMapReact from "google-map-react";

const GoogleMaps = () => {
  const apiKey = process.env;

  // Define the center coordinates for the map
  const center = {
    lat: 37.7749,
    lng: -122.4194,
  };

  return (
    <div style={{ height: "400px", width: "100%" }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: apiKey }}
        defaultCenter={center}
        defaultZoom={10}
      >
        {/* Place your custom components or markers on the map */}
        <Marker lat={37.7749} lng={-122.4194} text="Marker" />
      </GoogleMapReact>
    </div>
  );
};

// Define a custom marker component
const Marker = ({ text }) => <div style={{ color: "red" }}>{text}</div>;

export default MapComponent;
